description:
419 William S. Burroughs and related book covers in EPS format using the 8 color cutout technique as demonstrated at &lt;A HREF=http://popartmachine.com/&gt;http://popartmachine.com/&lt;/A&gt;

This is a sneak preview of an unpublished exhibit featuring William S. Burroughs.  Keep an eye on the Pop Art Machine site for the complete exhibit.  Should be a good one!

You can see specific WSB preview information here: 
&lt;A HREF=http://popartmachine.com/blog/?p=115&gt;William S. Burroughs: Cover Art: an Exhibit Preview&lt;/A&gt;

Specifics... this torrent contains 419 unedited EPS files.  As such, this is a preview and some images are better than others.  It is a small torrent at only 31 megabytes and change so it is worth your time if you enjoy William S. Burroughs or even if you just want to add to your vector art collection.
